import './blog.scss'
import Navbar from '../../component/navbar/Navbar'
import { useEffect } from 'react'


const Blog = ({data}) => {
    useEffect(()=>{
        console.log(data);

    },[])
  return (
    <>
    <Navbar active='blog'/>
    <div className='containerBlog'>

        <h1>Blog</h1>


    </div>
    </>
  )
}

Blog.getInitialProps = async ()=>{
    const res = await fetch('http://localhost:4000/contents')
    const data = await res.json()
    return{
        data : data
    }
}

export default Blog
